I could not figure out how to make it useful for this particular case. The `afterExecute` is defined in a more concrete ThreadPoolExecutor rather than in ExecutorService that ForwardingExecutorService implements. The implementation does not leave a second chance to handle unhandled error (ThreadPoolExecutor.runWorker):
```
                try {
                    beforeExecute(wt, task);
                    Throwable thrown = null;
                    try {
                        task.run();
                    } catch (RuntimeException x) {
                        thrown = x; throw x;
                    } catch (Error x) {
                        thrown = x; throw x;
                    } catch (Throwable x) {
                        thrown = x; throw new Error(x);
                    } finally {
                        afterExecute(task, thrown);
                    }
                } finally {
                    task = null;
                    w.completedTasks++;
                    w.unlock();
                }
```

